    fun MutableList<Int>.addToLimitedList(index: Int, element: Int, sizeLimit: Int) {
        this.add(index, element)
        if (this.size > sizeLimit) {
            this.removeAt(0)
        }
    }

    fun MutableList<Int>.addToLimitedList(element: Int, sizeLimit: Int) {
        this.add(element)
        if (this.size > sizeLimit) {
            this.removeAt(0)
        }
    }
